import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Home from "./Home";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Home />
      </main>
      <Footer />
    </div>
  );
}

export default App;
